import React from 'react';
import './App.css';
import {Switch,Router} from 'react-router-dom';

import HomePage from './pages/homepage.component'

const page = () => {
  return (
    <h1>Page Soem</h1>
  )
}

function App() {
  return (
    <div>
      <Switch>
        <Router exct path="/" component={HomePage} />
        <Router exct path="/hat" component={page} />
      </Switch>
    </div>
  );
}

export default App;
